static void fermi2002_parm_pdf(const LHAPDF_FLOAT *fp, double x, double *f)
{
  double uv, dv, g, S, D;

  uv = lhpdf_x_taylor(x, fp, 2.0, 5, 2,6,11,16,20);
  dv = lhpdf_x_taylor(x, fp, 2.0, 5, 3,7,12,17,21);
  g  = lhpdf_x_taylor(x, fp, 2.0, 5, 1,8,13,18,22);
  S  = lhpdf_x_taylor(x, fp, 2.0, 5, 4,9,14,19,23);
  D  = lhpdf_x_taylor(x, fp, 1.0, 5, 5,10,15,24,25);

  f[-6] = f[6] = 0.0;
  f[-5] = f[5] = 0.0;
  f[-4] = f[4] = 0.0;
  f[-3] = f[3] = 0.1*S;
  
  f[-2] = 0.2*S-0.5*D;
  f[-1] = 0.2*S+0.5*D;
  f[0] = g;
  f[1] = dv+f[-1];
  f[2] = uv+f[-2];
}

